import React from "react";
import { Button } from "./Nav.js";

export class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      password: "swordfish",
      authorized: false,
    };
    this.authorize = this.authorize.bind(this);
  }

  render() {
    return (
      <form id="form">
        <input></input>
        <Button name="submit" />
      </form>
    );
  }
}
